import React from 'react';
const List =(props)=>{
    return (<>
        <div className='box'>
            <h3 onChange={()=>{
                props.modi(props.id)
            }} contentEditable>{props.title}</h3>
            <pre contentEditable>{props.des}</pre>
            <i className="fa fa-trash" onClick={()=>{props.fun(props.id)}}></i>
        </div>
    </>);
}
export default List;
